import React, {useState} from 'react'
import SurfSpot from './SurfSpot'

const Home = ({data, handleVisited}) => {
    const [progress, setProgress] = useState(0)

    const totalSpots = data.length

    const filteredSpots = data.filter((surfspot) => surfspot.visited).length

    return(
        <div className="home"> 
                <progress value={filteredSpots / totalSpots} />
            {data && <SurfSpot spots={data} />}
        </div>
    )
}

export default Home;
